INSERT INTO `quemsomos` (`qsm_id`, `qsm_descricao`) VALUES
(1, 'Somos mais do que uma agência, somos um celeiro de artistas, onde cada profissional de nosso casting tem explorada suas diversas habilidades, afim de transformar artisticamente com a delicadeza e o toque que cada produção merece. \n<br><br>\nNosso processo de envio de casting é quase artesanal, selecionando os perfis entendendo as necessidades e sensibilidade de nossos clientes para cada projeto.');
INSERT INTO `servicos` (`svc_id`, `svc_descricao`, `svc_img`, `svc_titulo`, `svc_conteudo`, `svc_iconclass`) VALUES
(1, 'Curso de interpretação', '/images/icon-interpretacao.png', 'Curso de Interpretação para TV e Cinema', '<h4>Curso de Interpretação para TV e Cinema</h4>\n<p>O curso de interpretação para TV e cinema da <strong>agência galharufa</strong> proporciona aos alunos o domínio das técnicas de atuação para câmera, permitindo que eles desenvolvam suas habilidades cênicas nas linguagens de televisão e cinema.\n</p>\n<p>Além de exercícios práticos com gravações, leituras e avaliações, o curso é uma introdução para a carreira de ator ou aprimoramento para aqueles que já possuem uma base em teatro.\n</p>\n<p>A partir da gravação de cenas dramáticas e de constante avaliação do professor, são trabalhadas técnicas de posicionamento em cena, noções de enquadramento, áreas, planos e movimentos de câmera, entre outros exercícios específicos para atuação na câmera.</p>\n<p>Com textos de teledramaturgia, séries e cinema, o aluno aprende a construir personagens partindo de pontos pré-definidos ou de criação própria.</p>\n<p><strong>Conteúdo:</strong></p>\n<ol>\n<li>Posicionamento entre ator e câmera</li>\n<li>Exercícios práticos, simulações e improvisações</li>\n<li>Exercícios de sensibilização com a cena e de estimulo</li>\n<li>Intensidade do olhar</li>\n<li>Dicção, entonação de voz e limpeza de sotaques</li>\n<li>Linguagem Naturalista, Realista e Coloquial</li>\n<li>Limpeza e criação de mascaras faciais</li>\n<li>Conscientização de plano, contra plano e ambientação no estúdio</li>\n<li>Trabalho em grupo</li>\n<li>A percepção do outro</li>\n<li>Retorno do lúdico.</li>\n<li>Avaliação e Auto Avaliação</li>\n<li>Improvisação com exercícios de foco, objetivo, conflito e argumentação</li>\n<li>Improviso com pré definições de texto e personagem.</li>\n<li>Expressão corporal e exploração do espaço, utilizando o corpo e a voz como ferramentas.</li>\n<li>Desinibição e a espontaneidade, auxiliando a superar a timidez e expandir com eficácia sua comunicação.</li>\n</ol>\n<p><strong>Solicite seu orçamento através do e-mail <a href="mailto:atendimento@agenciagalharufa.com.br">atendimento@agenciagalharufa.com.br</a> ou através da nossa página de <a href="" ng-click="path(``/contato``);">Contato</a></strong></p>', 'bg-yellow-main'),
(3, 'Curso de Circo', '/images/icon-circo.png', 'Curso de Circo', '<h4>Curso de Circo</h4>\n<p>Este Projeto tem a importância de atender ao público em geral sem restrições de idade.</p>\n\n<p>Nosso foco de divulgação será a cultura, dando a possibilidade de conhecerem o mundo circense com técnicas renovadas, equipamentos e aparelhos diferenciados, buscando encantar e resgatar a criança que existe em cada um de nós.</p>\n<p>Proporcionar um diálogo melhor com o público e, conseqüentemente, reacendendo seu desejo em conhecer melhor mundo do circo, doando artes circenses e recebendo cultura popular.</p>\n\n<p>Entre causos e prosas surge uma história de paixão inseparável pelo circo. As oficinas circenses irão proporcionar aos participantes a oportunidade de conhecer e praticar algumas atividades com equipamentos de circo Tradicional.</p>\n\n<p><strong>Solicite seu orçamento através do e-mail <a href="mailto:atendimento@agenciagalharufa.com.br">atendimento@agenciagalharufa.com.br</a> ou através da nossa página de <a href="" ng-click="path(``/contato``);">Contato</a></strong></p>', 'bg-salmon-light'),
(4, 'Material fotográfico', '/images/icon-foto.png', 'Material fotográfico', '<h4>Material fotográfico</h4>\n<p>A importância de uma boa apresentação de material é essencial para aprovação do cliente, ou seja, possuir um material fotográfico de qualidade é o primeiro passo para obter o sucesso desejado na sua carreira.</p>\n<p>Nosso material é composto por:</p>\n<ul>\n<li>20 fotos contendo 10 delas tratadas pela equipe de design.</li>\n<li>2 trocas de look(roupa)</li>\n<li>Maquiagem incluso no pacote</li>\n<li><span class="red-text">*</span> Todas as fotos são realizadas em estudio</li>\n</ul>\n\n<p><strong>Solicite seu orçamento através do e-mail <a href="mailto:atendimento@agenciagalharufa.com.br">atendimento@agenciagalharufa.com.br</a> ou através da nossa página de <a href="" ng-click="path(``/contato``);">Contato</a></strong></p>', 'bg-purple-light'),
(5, 'Eventos', '/images/icon-eventos.png', 'Eventos', '<h4>Seja única! Seja Galharufa!</h4>\n\n<h6>Seu evento influencia todos os outros!</h6>\n<div class="spacing"></div>\n<p>A nossa missão é oferecer serviços em organizações e produções de eventos com qualidade e profissionalismo, buscando a satisfação de seus clientes.</p>\n<p>A nossa equipe de profissionais é treinada especificamente para cada segmento, garantido o sucesso do evento.\n</p>\n <ul>\n     <li>Recepcionistas</li>\n    <li>Bartenders</li>\n    <li>Garçons</li>\n    <li>Seguranças</li>\n    <li>Promotoras</li>\n    <li>Degustadoras</li>\n    <li>Equipe de limpeza</li>\n    <li>DJ''s</li>\n</ul>      \n\n<p><strong>Solicite seu orçamento através do e-mail <a href="mailto:atendimento@agenciagalharufa.com.br">atendimento@agenciagalharufa.com.br</a> ou através da nossa página de <a href="" ng-click="path(''/contato'');">Contato</a></strong></p>', 'bg-yellow-main'),
(6, 'Agenciamento', '/images/icon-agenciamento.png', 'Agenciamento', '<h4>Venha ser agenciado pela Galharufa!</h4>\n\n<div class="spacing"></div>\n\n<p>\n    <strong>Departamento Galharufa Infanto Juvenil</strong> - de 06 meses à 17 anos:<br>\n      Para pré-avaliação: enviar 03 fotos com nome e data de nascimento e \n      telefone para contato com DDD para <a href="mailto:infantil@agenciagalharufa.com.br" target="_blank">infantil@agenciagalharufa.com.br</a> e aguarde resposta.</p>\n<p><strong>Departamento Galharufa Adulto</strong> - A partir de 18 anos: <br>\n        Para pré-avaliação, enviar o seguinte material: 03 fotos com nome,data de nascimento, \n        telefone para contato com DDD para <a href="mailto:contato@agenciagalharufa.com.br" target="_blank">contato@agenciagalharufa.com.br</a></p>\n<p> <strong> Para pré avaliação - para ATORES</strong>, alem do material acima, encaminhar currículo atualizado e \n    link de atuação (se tiver) <a href="mailto:contato@agenciagalharufa.com.br" target="_blank">contato@agenciagalharufa.com.br</a> e aguarde resposta</p>', 'bg-yellow-main'),
(7, 'Videobook', '/images/icon-videobook.png', 'Videbook', '<h4>Videobook</h4>\n\n<div class="spacing"></div>\n\n<p> O videobook é a maior ferramenta de divulgação para atores, extremamente utilizado na \naprovação para testes de longas, séries e publicidades.</p>\n<p>\n    Realize seu monólogo conosco, com direção e escolha de textos no seu perfil!\n</p>\n<p>\n    Valor do investimento:\n</p>\n<ul>\n    <li>1 cena: R$ 250,00 (a vista) ou 2x R$ 150,00 no cartão de crédito.</li>\n    <li>2 cena: R$ 400,00 (a vista) ou 2x R$ 250,00 no cartão de crédito.</li>\n</ul>', 'bg-purple-light'),
(8, 'Convênios', '/images/icon-partner.png', 'Convênios', '<div class="row">\n  <div class="col s12 l12 m12 xl12">\n    <h4>Convênios</h4>\n    <div class="spacing"></div>\n  <div class="spacing"></div>\n  <div class="spacing"></div>\n  </div>\n  <div class="col s12 l6 m6 xl6">\n    <img  class="responsive-img" \n    src="../images/convenios/conv_dracecilia.jpg">\n  </div>\n  <div class="col s12 l6 m6 xl6">\n    <img  class="responsive-img" \n    src="../images/convenios/conv_fabi.jpg">\n  </div>\n  <div class="col s12 l6 m6 xl6">\n    <img  class="responsive-img" \n    src="../images/convenios/conv_ator.png">\n  </div>\n  <div class="col s12 l6 m6 xl6">\n    <img  class="responsive-img" \n    src="../images/convenios/conv_tatoo.jpg">\n  </div>\n</div>', 'bg-yellow-main');
